import React, { useState } from 'react';

const PayrollForm = () => {
  // State for storing form inputs
  const [formData, setFormData] = useState({
    payrollPeriod: '',
    payrollDate: '',
    grossAmount: '',
    netAmount: '',
    deductions: '',
    deductionAmount: '',
    totalAmount: '',
    workerId: '', // To associate the payroll with a specific worker
  });

  // State for managing success or error messages
  const [message, setMessage] = useState('');

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  // Handle form submission and send data to the backend API
  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('http://localhost:4000/api/payrolls', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        setMessage('Payroll added successfully!');
      } else {
        const errorText = await response.text();
        setMessage(`Failed to add payroll: ${errorText}`);
      }
    } catch (error) {
      setMessage(`Error: Failed to connect to the server. ${error.message}`);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="payrollPeriod">Payroll Period</label>
          <input
            type="text"
            id="payrollPeriod"
            name="payrollPeriod"
            value={formData.payrollPeriod}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="payrollDate">Payroll Date</label>
          <input
            type="text"
            id="payrollDate"
            name="payrollDate"
            value={formData.payrollDate}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="grossAmount">Gross Amount</label>
          <input
            type="number"
            id="grossAmount"
            name="grossAmount"
            value={formData.grossAmount}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="netAmount">Net Amount</label>
          <input
            type="number"
            id="netAmount"
            name="netAmount"
            value={formData.netAmount}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="deductions">Deductions</label>
          <input
            type="text"
            id="deductions"
            name="deductions"
            value={formData.deductions}
            onChange={handleChange}
          />
        </div>

        <div>
          <label htmlFor="deductionAmount">Deduction Amount</label>
          <input
            type="number"
            id="deductionAmount"
            name="deductionAmount"
            value={formData.deductionAmount}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="totalAmount">Total Amount</label>
          <input
            type="number"
            id="totalAmount"
            name="totalAmount"
            value={formData.totalAmount}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="workerId">Worker ID</label>
          <input
            type="number"
            id="workerId"
            name="workerId"
            value={formData.workerId}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit">Submit</button>
      </form>

      {message && (
        <div
          style={{
            marginTop: '20px',
            color: message.includes('successfully') ? 'green' : 'red',
          }}
        >
          {message}
        </div>
      )}
    </div>
  );
};

export default PayrollForm;
